Function estimatepi(numsamples) {
  let insidecircle = 0;

  for (let i = 0; i < numsamples; i++) {
    const x = math.random();
    const y = math.random();
    if (x * x + y * y <= 1) {
      insidecircle++;
    }
  }

  return (insidecircle / numsamples) * 4;
}

// example usage
const samples = 1_000_000;
console.log(`estimated pi: ${estimatepi(samples)}`);

